import React from 'react';
import Card from './Card'
import estilos from './Cards.module.css'

export default function Cards({cities, onClose}) {
  if (cities) {
    return (
      <div className={estilos.cardsStyle}>
        {
        cities ? 
        cities.map(c => <Card
          key={c.id}
          max={c.max}
          min={c.min}
          name={c.name}
          img={c.img}
          onClose={() => onClose(c.id)}
          id={c.id}
        />)
      
       : <div> </div>
      } 
      </div>
    );
  } else {
    return (
      <div>Sin ciudades</div>
    )
  }
}
